import React from "react";
import { Row, Col, Card, Input, Button } from "react-materialize";

const test = async () => {
  const requestOptions = {
    method: "POST",
    headers: { "Content-Type": "application/json" },
    body: JSON.stringify({
      email: "peter@klaven",
      password: "cityslicka",
    }),
  };
  const response = await fetch(
    "https://reqres.in/api/login?delay=2",
    requestOptions
  );
  const data = await response.json();
  console.log(data);
};

const Home = () => (
  <Row>
    <Col m={12} s={12}>
      <h5>Login</h5>
      <Card>
        <Row>
          <Input
            placeholder="lorem@ipsum.com"
            type="email"
            label="Email"
            s={12}
          />
          <Input placeholder="Senha" label="Senha" type="password" s={12} />
          <Col s={12} m={12}>
            <Button
              waves="light"
              className="right grey darken-2"
              onClick={test}
            >
              ENTRAR
            </Button>
          </Col>
        </Row>
      </Card>
    </Col>
  </Row>
);

export default Home;
